import React, { Component } from 'react';
import './Home.css';

import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
import Habitrabbit from "../../assets/white-rabbit.png";

console.log(Habitrabbit);

class Home extends React.Component {
    render() {
        return (
            <div class="body">
                <Header />
                <div class="home-page">
                    <div class="upper-home">
                        <p class="upper-home-text">
                            Let's improve your good habits with Habit Rabbit !
                        </p>
                        <div className="row row-cols-3">
                            <div className="col col-md justify-content-center order-1">
                                <button type="submit" id="get-started">Get Started</button>
                            </div>
                            <div className="col col-md mr-0 pr-0 order-0">
                                <img className="Habitrabbit" src={Habitrabbit} />
                            </div>
                            <div className="col col-md mr-0 pr-0 order-2"></div>
                        </div>
                    </div>
                    <div class="lower-home">
                        {/* <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="red" d="M 0 200 Q 750 200 800 150 L 800 200 Z"/></svg> */}
                        {/* Infographic about mental health awareness and benefits of making good habits */}
                    </div>
                </div>
                <Footer />
            </div>
        );
  }
}

export default Home;
